import React from "react";
import CircularProgress from "@material-ui/core/CircularProgress";

export default function index(props) {
  console.log(props.mainPrimaryColor, "amnah");

  return (
    <div style={{ display: "flex", justifyContent: "space-between" }}>
      <div style={{ display: "flex" }}>
        <div>
          <div className="text-color-details">Quality</div>
          <div>80</div>
        </div>
        <CircularProgress variant="static" color="secondary" value={75} />
      </div>
      <div>
        <div className="text-color-details">Handicap</div>
        <div>PRO</div>
      </div>
      <div>
        <div className="text-color-details">SG TOTAL</div>
        <div>4.14</div>
      </div>
    </div>
  );
}
